WITH pending_tab AS 
(SELECT 
        pd.uid,
        JSON_EXTRACT(pd.extra_data,'$.reason_description') AS driver_description,
        JSON_EXTRACT(pd.extra_data,'$.reason_description_admin') AS admin_description,
        re.name_vn AS pending_reason_name,
        DATE(FROM_UNIXTIME(pd.create_time - 3600)) AS pending_date

FROM shopeefood.foody_internal_db__shipper_log_pending_reason_tab__reg_daily_s0_live pd

LEFT JOIN shopeefood.foody_internal_db__shipper_log_pending_reason_tab__reg_daily_s0_live filter on filter.uid = pd.uid and pd.update_time < filter.update_time

LEFT JOIN dev_vnfdbi_opsndrivers.driver_pending_reason_tab re on cast(re.reason_id as bigint) = pd.reason_id

WHERE 1 = 1  
AND pd.is_deleted = 0
)
SELECT 
        sp.uid,
        CASE 
        WHEN sp.take_order_status = 1 then 'Normal' 
        WHEN sp.take_order_status = 2 then 'Stop'
        else 'Pending' end as order_status,
        CASE 
        WHEN sp.working_status = 1 then 'Normal' 
        WHEN sp.working_status = 2 then 'OFF'
        else 'Pending' end as working_status,
        CASE 
        WHEN sp.take_order_status = 3 then pd.pending_date
        ELSE NULL END AS pending_date,
        CASE 
        WHEN sp.take_order_status = 3 then coalesce(pd.pending_reason_name,null)
        ELSE NULL END AS pending_reason,
        CASE 
        WHEN sp.take_order_status = 3 then coalesce(pd.driver_description,null)
        ELSE NULL END AS driver_description,
        CASE 
        WHEN sp.take_order_status = 3 then coalesce(pd.admin_description,null)
        ELSE NULL END AS admin_description,
        coordinator_note
                           

FROM shopeefood.foody_internal_db__shipper_profile_tab__reg_continuous_s0_live sp

